import React from 'react';


function Cal(){
var a=12;
var b=42;
 

var sum =(a+b);
var dev =(a/b);
var mul =(a*b);
var sub =(a-b);

return <>
 <p>
     Addtion is ::
     {sum}</p>
 <br/>
 <p> Subtraction is ::{sub}</p>
 <br/>
 <p> multiplication is::{mul}</p>
 <br/>  
 <p>{dev}</p>
</>;




}

export default Cal;
